package edu.pitt.hashtable;

import java.util.HashMap;

/**
 * Minimum Window Substring #76 --- Accepted 526ms
 * Given a string S and a string T, find the minimum window in S which will contain all the characters in T in complexity O(n).
 * For example,
 * S = "ADOBECODEBANC"
 * T = "ABC"
 * Minimum window is "BANC".
 * Note:
 * If there is no such window in S that covers all characters in T, return the emtpy string "".
 * If there are multiple such windows, you are guaranteed that there will always be only one unique minimum window in S. 
 * @author yanma
 * @since 2015-06-23
 * @version 2015-06-23
 */
public class MinimumWindowSubstring_76 {
	
    public static String minWindow(String s, String t) {
        if (s == null || t == null || s.length() == 0 || t.length() == 0) {
        	return "";
        }
        
        HashMap<Character, Integer> toFind = new HashMap<Character, Integer>();
        HashMap<Character, Integer> found = new HashMap<Character, Integer>();
        //add String T to hashmap toFind
        for (int i = 0; i < t.length(); i++) {
			char c = t.charAt(i);
			if (!toFind.containsKey(c)) {
				toFind.put(c, 1);
			} else {
				toFind.put(c, toFind.get(c) + 1);
			}
		}
        
        String resultString = "";
        int count = 0;
        int leftbound = 0;
        for (int index = 0; index < s.length(); index++) {
        	char c = s.charAt(index);
        	if (!toFind.containsKey(c)) { 
        		continue; // little tip
        	}
        	
    		if (!found.containsKey(c)) {
				found.put(c, 1);
			} else {
				found.put(c, found.get(c) + 1);
			}
    		if (found.get(c) <= toFind.get(c)) {
    			count++;
    		}
    		
        	if (count == t.length()) {
        		while (leftbound < s.length()) {
					char left = s.charAt(leftbound);
					if (!toFind.containsKey(left)) {
						leftbound++;
						continue;
					}
					if (found.get(left) > toFind.get(left)) {
						leftbound++;
						found.put(left, found.get(left) - 1);
						continue;
					}
					break;
				}
        		
        		if (resultString.equals("") || index - leftbound + 1 < resultString.length()) {
        			resultString = s.substring(leftbound, index + 1);
        		}
        	}
        }
    	
    	return resultString;
    }
	
    
    public static void main(String[] args) {
    	String s = "";
    	String t = "";
    	String reString = "";
    	System.out.println(minWindow(s, t).equals(reString));
    }

}
